import React from "react";
import { NavLink } from "react-router-dom";

const NavItem = ({ icon, title, path }) => {
  return (
    <NavLink
      key={title}
      id="navItems"
      className="nav-item nav-link"
      to={`${path}`}
    >
      <img src={icon} width="10px" />
      {title}
    </NavLink>
  );
};

export default NavItem;
